insert into auth.users (id, aud, role) values (gen_random_uuid(), 'authenticated', 'authenticated');
insert into public.plans (
  id,
  user_id,
  created_at,
  modified_at,
  start_lat,
  start_lon,
  finish_lat,
  finish_lon,
  state,
  name,
  trip_type,
  distance,
  start_desc,
  finish_desc,
  rule_set_id
) values (
  ksuid(),
  (select id from auth.users limit 1),
  now(),
  now(),
  57.153,
  24.853,
  57.25807403431557,
  25.35245771859684,
  'new',
  '',
  'start-finish',
  999,
  'start desc',
  'finish desc',
  (select id from rule_sets limit 1)
);

with latest_plan as (
  select id from public.plans 
  order by created_at desc 
  limit 1
)
select pgmq.send(
  queue_name => 'plan_new'::text,
  msg        => jsonb_build_object('planId', id)
) 
from latest_plan;
